import axios from "axios";
import { Column } from "primereact/column";
import { DataTable } from "primereact/datatable";
import { useEffect, useState } from "react";
import { API_URL } from "../constants/constants";

export const Famille = () => {

    const [famille, setFamille] = useState([]);

    useEffect(() => {
        if(localStorage.getItem('access_token') === null){                   
            window.location.href = '/login'
        }
        else{
         (async () => {
           try {
            const token = localStorage.getItem('access_token')
             const {data} = await axios.get(   
                            API_URL + 'famille/', {
                            headers: {
                                Authorization: `Bearer ${token}`
                                }}
                           );
             setFamille(data);
          } catch (e) {
            console.log('not auth'+ e)
          }
         })()};
    }, []);


      return (
        <div style={{maxWidth: 1440, marginLeft: 'auto', marginRight: 'auto'}}>
          <DataTable value={famille}>
            <Column field="id" header="ID" />
            <Column field="firstname" header="Last Name" />
            <Column field="lastname" header="First Name" />
            <Column field="address" header="Incognito" />
            <Column field="contact" header="Incognito" />
            <Column field="address" header="Incognito" />


          </DataTable>
        </div>
      );
  }
